function [rho] = BakerBradley_spectral_2017(T1, T2,~)

% Jack W. Baker and Brendon A. Bradley (2017) Intensity Measure 
% Correlations Observed in the NGA-West2 Database, and Dependence
% of Correlations on Rupture and Site Parameters. Earthquake Spectra: 
